import asyncio
from typing import List, Callable, Any

async def batch_processor(
    items: List[Any],
    processor: Callable[[Any], Any],
    batch_size: int = 10,
    max_concurrent: int = 5,
    timeout: float = 30.0
):
    semaphore = asyncio.Semaphore(max_concurrent)
    results = []

    async def process_with_semaphore(item):
        async with semaphore:
            try:
                if asyncio.iscoroutinefunction(processor):
                    result = await asyncio.wait_for(processor(item), timeout=timeout)
                else:
                    result = await asyncio.to_thread(processor, item)
                return (item, result, None)
            except asyncio.TimeoutError:
                return (item, None, "timeout")
            except Exception as e:
                return (item, None, str(e))

    for i in range(0, len(items), batch_size):
        batch = items[i:i + batch_size]
        batch_results = await asyncio.gather(*[process_with_semaphore(item) for item in batch])
        results.extend(batch_results)

    return results

